import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom'
import * as instagram from './Instagram.js';
import * as cats from './Cats.js';
import './App.css';


console.log(instagram.add(1, 2));

class NewsApiComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    let url = "https://newsapi.org/v2/everything?q=fortnite&from=2019-11-12&sortBy=publishedAt&apiKey=3c7a7bde959b42aa954054ba2f493814&language=en";
    let url2 = "https://newsapi.org/v2/everything?q=fortnite&from=2019-11-12&sortBy=publishedAt&apiKey=3c7a7bde959b42aa954054ba2f493814&language=fr";
    Promise.all([fetch(url)], [fetch(url2)])
      .then(([res1, res2]) => {
        return Promise.all([res1.json(), res2.json()])
      })
      .then(([res1, res2]) => {
          this.setState({
            isLoaded: true,
            items: res1,
            itemfr: res2
          });

        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      ).catch(console.log)

  }
  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return (
        <div className="column is-three-fifths is-offset-one-quarter catbox">
          <div className="cat">
            <div className="cat__body"></div>
            <div className="cat__body"></div>
            <div className="cat__tail"></div>
            <div className="cat__head"></div>
          </div>
        </div>
      );
    } else {
      console.log(items);
      return (
        <div className="columns is-multiline is-mobile is-centered">

          {items.articles.map(item => (
            <div className="column is-6">
              <div className="box">
                <article className="media">
                  <div className="media-content">
                    <div className="content">
                      <a href={item.url}>
                        <strong className="mediaposts-title">{item.title}</strong> <small></small>
                      </a>
                      <p>{item.content}</p>
                    </div>
                    <nav className="level is-mobile">
                      <div className="level-left">
                        <a className="level-item" aria-label="reply">
                          <span className="icon is-small">
                            <i className="fas fa-reply" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a className="level-item" aria-label="retweet">
                          <span className="icon is-small">
                            <i className="fas fa-retweet" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a className="level-item" aria-label="like">
                          <span className="icon is-small">
                            <i className="fas fa-heart" aria-hidden="true"></i>
                          </span>
                        </a>
                      </div>
                    </nav>
                  </div>
                </article>
              </div>

            </div>
          ))}
          {itemsfr.articles.map(item => (
            <div className="column is-6">
              <div className="box">
                <article className="media">
                  <div className="media-content">
                    <div className="content">
                      <a href={item.url}>
                        <strong className="mediaposts-title">{item.title}</strong> <small></small>
                      </a>
                      <p>{item.content}</p>
                    </div>
                    <nav className="level is-mobile">
                      <div className="level-left">
                        <a className="level-item" aria-label="reply">
                          <span className="icon is-small">
                            <i className="fas fa-reply" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a className="level-item" aria-label="retweet">
                          <span className="icon is-small">
                            <i className="fas fa-retweet" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a className="level-item" aria-label="like">
                          <span className="icon is-small">
                            <i className="fas fa-heart" aria-hidden="true"></i>
                          </span>
                        </a>
                      </div>
                    </nav>
                  </div>
                </article>
              </div>

            </div>
          ))}

        </div>
      );
    }
  }
}

